@Component({
  selector: 'app-pendingcomplaints',
  templateUrl: './pendingcomplaints.component.html',
  styleUrls: ['./pendingcomplaints.component.scss']
})
export class PendingcomplaintsComponent implements OnInit {

  constructor(private backendservice:BackEndServiceService,protected route:ActivatedRoute,private http:HttpClient,private fb:FormBuilder) {}

  ngOnInit():void{
    this.backendservice.getpendingcomplaints().subscribe((res)=>{this})
  }

}
